import React from "react";

export default function ProfilePage(props) {
    console.log(props);
    return (
        <div>
            <section>
                <p><strong>User:</strong>*{props.user.name}*</p>
            </section>
            <section>
            <p><strong>Theme:</strong>*{props.theme.name}*</p>
            </section>
        </div>
    )
}
